package com.edu;

public class Operator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
    int a,b;
    a=10;
    b=10;
    a++;
    ++b;
    System.out.println("a="+ ++a);
    System.out.println("b="+ b++);
    System.out.println("b="+b);


	}

}
